import classes from "./Projects.module.css";
import initiatives from "../../assets/images/initiatives.png";
import survey from "../../assets/images/survey.png";

const Projects = () => {
  const projectsList = [
    {
      id: "initiatives",
      name: "Initiatives App",
      image: initiatives,
      description: `Combat tracker suitable for the most played TTRPG game of all times: ${(
        <br />
      )} Dungeons & Dragons`,
    },
    {
      id: "survey",
      name: "Harry Potter Survey From",
      image: survey,
      description: `A survey form about the fantasy novel: ${(
        <br />
      )} Harry Potter`,
    },
  ];

  return (
    <div className={classes.projects} id="projects">
      <p>Here are my most recent projects</p>
      <div className={classes.container}>
        <div className={classes.flag}>
          <p className={classes.name}>Initiatives App</p>
          <a
            href="https://bcakko.github.io/initiatives-app/"
            target="_blank"
            rel="noreferrer"
          >
            <img src={initiatives} alt="combat-tracker-app" />
          </a>
          <p>
            Combat tracker suitable for the most played TTRPG game of all times:{" "}
            <br /> Dungeons
            {" & "}
            Dragons
          </p>
        </div>
        <div className={classes.flag}>
          <p className={classes.name}>Harry Potter Survey From</p>
          <a
            href="https://codepen.io/bcakko/full/LYyJwMb"
            target="_blank"
            rel="noreferrer"
          >
            <img src={initiatives} alt="combat-tracker-app" />
          </a>
          <p>
            Combat tracker suitable for the most played TTRPG game of all times:{" "}
            <br /> Dungeons
            {" & "}
            Dragons
          </p>
        </div>
        <div className={classes.flag}>
          <p className={classes.name}>Product Landing Page</p>
          <a
            href="https://bcakko.github.io/initiatives-app/"
            target="_blank"
            rel="noreferrer"
          >
            <img src={initiatives} alt="combat-tracker-app" />
          </a>
          <p>
            Combat tracker suitable for the most played TTRPG game of all times:{" "}
            <br /> Dungeons
            {" & "}
            Dragons
          </p>
        </div>
      </div>
    </div>
  );
};

export default Projects;
